import React from 'react';
import Table from 'react-bootstrap/Table'

const Cartlist1 = (props) => {

   
 return(
        <div >
          <Table >
                 <tbody>
                     <tr>
                     <td><b>{props.couponcode}</b></td>
                     <td><b>{props.price}</b></td>
                     <td><b>Rs.{props.off}</b></td>
                     </tr>
                 </tbody>
           </Table>
        </div>
       
 )                               
           
    
}

export default Cartlist1;
